import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h4>Just demos</h4>
      <form>
        <input type="text" id="username" name="username" placeholder="username"></input>
      </form>
    </div>
  );
}

export default App;
